        """.trimIndent()

        val json = Json { ignoreUnknownKeys = true }
        val signatures = mutableMapOf<ClickSignature, Int>()

        rawLogs.lineSequence().forEach { line ->
            if (line.isBlank()) return@forEach
            try {
                val root = json.parseToJsonElement(line).jsonObject

                // Extract relevant fields
                val sourceNode = root["sourceNode"]?.jsonObject
                val targetId = root["targetId"]?.jsonPrimitive?.content
                    ?: sourceNode?.get("id")?.jsonPrimitive?.content

                val targetText = root["targetText"]?.jsonPrimitive?.content
                    ?: sourceNode?.get("text")?.jsonPrimitive?.content

                val desc = sourceNode?.get("desc")?.jsonPrimitive?.content

                // Deep extraction of children text (crucial for DoorDash buttons)
                val childrenTxt = extractChildrenText(sourceNode.toString())

                val sig = ClickSignature(
                    targetId = targetId?.substringAfter("id/"), // Clean up ID
                    targetText = targetText,
                    desc = desc,
                    childrenText = childrenTxt
                )

                signatures[sig] = signatures.getOrDefault(sig, 0) + 1

            } catch (e: Exception) {
                println("Failed to parse line: $line")
            }
        }

        println("=== UNIQUE CLICKS FOUND: ${signatures.size} ===")
        signatures.entries.sortedByDescending { it.value }.forEach { (sig, count) ->
            println("[$count] $sig")
        }

        println("\n=== SUGGESTED MATCHERS ===")
        generateMatchers(signatures.keys)
    }

    private fun extractChildrenText(nodeJson: String): String? {
        // Quick dirty regex to find "text" fields inside the children JSON string
        val regex = "\"text\":\"([^\"]+)\"".toRegex()
        val matches = regex.findAll(nodeJson).map { it.groupValues[1] }.toList()
        return if (matches.isNotEmpty()) matches.joinToString(", ") else null
    }

    private fun generateMatchers(signatures: Set<ClickSignature>) {
        signatures.forEach { sig ->
            val idCondition = sig.targetId?.let { "id.endsWith(\"$it\")" }
            val textCondition = sig.childrenText?.let { "hasText(\"$it\")" }
                ?: sig.targetText?.let { "hasText(\"$it\")" }

            if (idCondition != null && textCondition != null) {
                println("    $idCondition && $textCondition -> ClickAction.TODO")
            } else if (idCondition != null) {
                println("    $idCondition -> ClickAction.TODO")
            } else if (textCondition != null) {
                println("    $textCondition -> ClickAction.TODO")
            }
        }
    }
